import React from 'react';
//import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Register from './pages/register';

function App() {
  return (
    <div className="App">

      <Router>
        		<Routes>
          			<Route exact path='/'>
                  Hi
                </Route>
                <Route exact path='/register'>
                </Route>
        		</Routes>
    	</Router>
    </div>
  );
}

export default App;
